class Solution:
    def isSubsequence(self, s, t):
        if s == '':
            return True
        if t == '':
            return False
        i = 0
        for letter in s:
            while i<len(t) and not t[i] == letter:
                i += 1
            if i == len(t):
                return False
            if t[i] == letter:
                i += 1
        return True


